import { useState } from "react";
import data from "../data.js";

function Main (props){

    let [test, setTest] = useState(data);

    return(
    <div>
    <h1>심리테스트</h1>
    {data.map((test) => (
          <li key={data.id}>{test.text}</li>
        ))}
    </div>
    )
}

export default Main;
